import React, { useState } from 'react';
import logo from './logo.svg';
import './App.css';
import { LoginRequestDTO } from './dtos/requests/auth/LoginRequestDTO';
import { login, register } from './services/AuthService';
import { RegisterRequestDTO } from './dtos/requests/auth/RegisterRequestDTO';
import { RegisterResponseDTO } from './dtos/responses/auth/RegisterResponseDTO';
import { UserRole } from './models/user/UserRole';

const App: React.FC = () => {
	// State for the credentials
	const [username, setUsername] = useState<string>('');
	const [password, setPassword] = useState<string>('');

	// Handler for the login button click
	const handleLogin = async () => {
		const credentials: LoginRequestDTO = { username: 'kfejzic', password: 'fejza1234' };
		console.log('credentials: ', credentials);

		try {
			await login(credentials);
			console.log('Login successful!');
		} catch (error) {
			console.error('Login failed:', error);
		}
	};

	const handleRegister = async () => {
		const credentials: RegisterRequestDTO = {
			firstName: 'John',
			lastName: 'Doe',
			identificationNumber: '123',
			address: '123 Main St',
			phone: '555-123-4567',
			email: 'johndoe@example.com',
			password: 'secret123',
			role: UserRole.EMPLOYEE,
		};

		const response: RegisterResponseDTO = await register(credentials);
		console.log('Register response: ', response);
	};

	return (
		<div className='App'>
			<div>
				<button onClick={handleLogin}>Login</button>
			</div>
			<div>
				<button onClick={handleLogin}>Register</button>
			</div>
		</div>
	);
};

export default App;
